create table objects
(
    object_id         bigint auto_increment
        primary key,
    is_wall           varchar(255) not null,
    object_category   varchar(255) not null,
    object_height     double       not null,
    object_image_path varchar(255) not null,
    object_model_path varchar(255) not null,
    object_name       varchar(255) not null,
    object_thing      bigint       null,
    object_width      double       not null
);

